import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import './navigationbar-styles.css';


import { Link } from "react-router-dom";



class NavigationBar extends Component {

  state = {
    isOpen: false,
    isOpen2: false

  };

  toggleOpen = () => this.setState({ isOpen: !this.state.isOpen });
  toggleOpen2 = () => this.setState({ isOpen2: !this.state.isOpen2 });


    render(){
      const menuClass = `dropdown-menu${this.state.isOpen ? " show" : ""}`;
      const menuClass2 = `dropdown-menu${this.state.isOpen2 ? " show" : ""}`;

        return (

          <div>
            <Navbar variant="dark" >
            <Navbar.Brand href="/home" className = "navLogo" >
              < img 
                src= "./logo.png"
                width="70"
                height="70"
                alt="EZiBuy logo"
              />
          </Navbar.Brand>
              <Nav className="mr-auto">
                <li><Link className="NavLink" to="/home">EzIBuy</Link></li>                

                <div className="dropdown" >

                  <a className="dropdown-toggle" onClick={this.toggleOpen}>Categorias</a>

                  <div className={menuClass}>
                    <a className="dropdown-item" href="#">Action</a>
                    <a className="dropdown-item" href="#">Another action</a>

                    <div className="btn-group dropright ml-2 mt-5" onClick={this.toggleOpen2}>
                      <button type="button" class="btn btn-secondary dropdown-toggle" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                       Categorias
                      </button>
                      <div className={menuClass2}>
                        <a class="dropdown-item" href="#">Action</a>
                        <a class="dropdown-item" href="#">Another action</a>
                        <a class="dropdown-item" href="#">Something else here</a>
                        <div class="dropdown-divider"></div>
                        <a class="dropdown-item" href="#">Separated link</a>
                      </div>
                    </div>
                  </div>
                </div>
                <li><Link className="NavLink" to="/login">Ingresar</Link></li>
                <li><Link className="NavLink" to="/">Registrarse</Link></li>
                <li><Link className="NavLink" to="/invoice">...</Link></li>
              </Nav>

              <Form inline>
                <FormControl type="text" placeholder="Buscar" className="mr-sm-2" />
                <Button variant="outline-light">Buscar</Button>
              </Form>
            </Navbar>
          </div>

        );
    }
}

export default NavigationBar;
